import React from "react";
import logo from "../assets/logo.svg";
const Header = () => {
  return;
  <>
    <Header>
      <div className="logo">
        <img src={logo} alt="Taskmate Project"></img>
      </div>
    </Header>
    ;
  </>;
};

export default Header;
